'use strict';

(function ($) {

  // 初始化分页
  var count = parseInt($('#totalCount').val());
  var page = parseInt($('#page').val()) - 1;
  var pageCount = parseInt($('#pageCount').val());
  var opts = {
    current_page: page,
    items_per_page: pageCount
  };

  //传入总条数
  $("#webPagination").pagination(count, opts);
})(jQuery);
